import React, { Fragment, Component } from 'react'

class ClassAverage extends Component {
    render() {
        return(
            <Fragment>
                <div className="btn btn-info">Show Average</div>
                <span style={{border: "5px solid Red"}}></span>
            </Fragment>
        )
    }
}
export default ClassAverage
